// 320. Generalized Abbreviation
// https://leetcode.com/problems/generalized-abbreviation/
#include <iostream>
#include <cassert>
#include <cctype>
#include <string>
#include <vector>
#include <unordered_set>
#include <algorithm>
#include <iterator>
using namespace std;

class Solution {
public:
	vector<string> generateAbbreviations(string word) {
		if (word.empty()) {
			return {""};
		}
		string solution;
		vector<string> result;
		generateAbbreviations(0, solution, word, result);
		return result;
	}
private:
	void generateAbbreviations(const size_t i, string& solution, const string word, vector<string>& result) {
		if (i == word.size()) {
			result.push_back(solution);
			return;
		}
		solution.push_back(word[i]);
		generateAbbreviations(i + 1, solution, word, result);
		solution.pop_back();
		for (size_t j = i + 1; j <= word.size() && (solution.empty() || isalpha(solution.back())); j++) {
			const size_t length = j - i;
			const string lengthStr = to_string(length);
			solution.append(lengthStr);
			generateAbbreviations(j, solution, word, result);
			for (size_t k = 0; k < lengthStr.size(); k++) {
				solution.pop_back();
			}
		}
	}
};

